import React from "react";
import { ReScreen } from 'regraph-next';

function EditorDemo(){
    return (
        <div className="editor-wrapper">
            <ReScreen
                height = {500}
                width = {500}
                mapWidth = {200}
                mapHeight = {200}
                type="DOM"
                mapPosition = "RT-IN" >
                <svg>
                    <g>
                        <circle cx={0} cy={0} r={500} fill="yellow" />
                        <circle cx={40} cy={40} r={250} fill="red" />
                    </g>
                </svg>
            </ReScreen>
        </div>
    )
}
export default EditorDemo
